import React from 'react'
import "./navbar.css"
const NavBar = () => {
  return (
		<div>
			<nav>
				<a href="#">Home</a>
				<a href="#">About</a>
				<a href="#">Services</a>
				<a href="#">Contact</a>
			</nav>
		</div>
	);
}

export default NavBar
